import React from 'react';
import Styles from './ProfileCard.module.css';
import {Link} from 'react-router-dom'
const ProfileCard = ({historys})=>{
    return (

        <a onclick = {
            ()=>{historys.push('./profile')}
        }href =''>
            <div className  = {Styles.card} >
            </div>
        </a>
    )
}
export default ProfileCard;
